INSERT INTO `vocab` VALUES ('abundance','abundance (of something) a large quantity that is more than enough','sự phong phú, thừa thãi','Currently, 118 chemical elements are known, though they vary widely in abundance.',NULL,61,'n','/əˈbʌndəns/','2022-06-07 03:01:45','https://www.oxfordlearnersdictionaries.com/media/english/us_pron/a/abu/abund/abundance__us_1.mp3',NULL,'2022-06-07 03:01:45',4),('account for',' to be the explanation or cause of something','giải thích','Of course, in order to apply the first law of thermodynamics to these processes, we still need to account for any work that accompanies the process.',NULL,575,NULL,NULL,'2022-07-03 08:47:35',NULL,NULL,'2022-07-03 08:47:35',11),('acre','a unit for measuring an area of land; 4 840 square yards or about 4 050 square metres','mẫu Anh','An acre is yd2',NULL,202,'n','/ˈeɪkər/','2022-06-10 08:27:10','https://www.oxfordlearnersdictionaries.com/media/english/us_pron/a/acr/acre_/acre__us_1.mp3',NULL,'2022-06-10 08:27:10',3),('active ','always busy doing things, especially physical activities','tại ngũ','He was impressed with two of his uncles who joined the military and earned a retirement-and-entitlement package for life after twenty years of active service. ',NULL,231,'adj','/ˈæktɪv/','2022-06-12 03:18:13','https://www.oxfordlearnersdictionaries.com/media/english/us_pron/a/act/activ/active__us_2.mp3',NULL,'2022-06-12 03:18:13',5),('adhere to','adhere (to something) to stick to something','bám vào (bề mặt, tường...)','The differing abilities of substances to adhere to the surfaces of solids can also be',NULL,91,'ph v','/ədˈhɪr/','2022-06-08 00:31:13','https://www.oxfordlearnersdictionaries.com/media/english/us_pron/a/adh/adher/adhere__us_1.mp3',NULL,'2022-06-08 00:31:13',3),('adhesive','​a substance that you use to make things stick together','chất dính','The adhesive takes at least an hour to set.',NULL,48,'n','/ədˈhiːsɪv/','2022-06-07 02:30:41','https://www.oxfordlearnersdictionaries.com/media/english/us_pron/a/adh/adhes/adhesive__us_1_rr.mp3',NULL,'2022-06-07 02:30:41',4),('affinity','a close relationship between two people or things that have similar qualities, structures or features','sự tương tự, sự giống nhau, ái lực','binding affinity',NULL,128,'n','/əˈfɪnəti/','2022-06-09 01:45:16','https://www.oxfordlearnersdictionaries.com/media/english/us_pron/a/aff/affin/affinity__us_1.mp3',NULL,'2022-06-09 01:45:34',5),('affluent ','having a lot of money and a good standard of living','giàu có','The managers of the plantation and the other affluent people, such as doctors, business owners, and bankers, sent their children to this elementary school. ',NULL,239,'adj','/ˈæfluənt/','2022-06-12 03:39:06','https://www.oxfordlearnersdictionaries.com/media/english/us_pron/a/aff/afflu/affluent__us_1.mp3',NULL,'2022-06-12 03:39:06',4),('agriculture','the science or practice of farming','nông nghiệp','50% of the country’s population depends on agriculture.',NULL,43,'n','/ˈæɡrɪkʌltʃər/','2022-06-07 02:18:34','https://www.oxfordlearnersdictionaries.com/media/english/us_pron/a/agr/agric/agriculture__us_1.mp3',NULL,'2022-06-07 02:18:34',4),('alchemy','a form of chemistry studied in the Middle Ages that involved trying to discover how to change ordinary metals into gold','thuật giả kim','Many of the early studies on gold arose from alchemy, in which people attempted to turn cheap metals, such as lead, into gold. ',NULL,512,'n','/ˈælkəmi/','2022-06-20 07:40:25','https://www.oxfordlearnersdictionaries.com/media/english/us_pron/a/alc/alche/alchemy__us_1.mp3',NULL,'2022-06-20 07:40:25',12),('algae','very simple plants, such as seaweed, that have no real leaves, stems or roots, and that grow in or near water','tảo','With the Energy Policy Act of 2005, the US Congress gave a big push to fuels derived from biomass (plants or algae) as a renewable alternative to gasoline. ',NULL,115,'n','/ˈældʒiː/','2022-06-08 07:11:19','https://www.oxfordlearnersdictionaries.com/media/english/us_pron/a/alg/algae/al