ia/english/us_pron/a/ana/anaer/anaerobic__us_1.mp3',NULL,'2022-07-11 04:00:19',2),('anesthetic','a drug that makes a person or an animal unable to feel anything, especially pain, either in the whole body or in a part of the body','thuốc tê, thuốc mê','nitrous oxide, a substance used as an anesthetic and commonly called laughing gas, molecular formula N2O',NULL,356,'n','/ˌænəsˈθetɪk/','2022-06-14 02:04:14','https://www.oxfordlearnersdictionaries.com/media/english/us_pron/a/ana/anaes/anaesthetic__us_1.mp3',NULL,'2022-06-14 02:04:14',6),('angina','severe pain in the chest caused by a low supply of blood to the heart during exercise because the arteries are partly blocked','chứng đau thắt ngực','Rather surprisingly, it also is used as a medication, to relieve angina','https://www.oxfordlearnersdictionaries.com/definition/english/angina?q=angina',673,'noun','/ænˈdʒaɪnə/','2022-07-11 04:17:27','https://www.oxfordlearnersdictionaries.com/media/english/us_pron/a/ang/angin/angina__us_1.mp3',NULL,'2022-07-11 04:17:27',1),('anion','an ion with a negative electrical charge','ion âm','An ion with a positive charge is a cation (pronounced CAT-ion); a negatively charged ion is an anion (AN-ion).',NULL,360,'n','/ˈænaɪən/','2022-06-14 02:14:32','https://www.oxfordlearnersdictionaries.com/media/english/us_pron/a/ani/anion/anion__us_1.mp3',NULL,'2022-06-14 02:14:32',5),('antacid','a medicine that prevents or corrects acidity, especially in the stomach','chất làm giảm độ axit','Sometimes sodium bicarbonate is used as an antacid to soothe an upset stomach ',NULL,487,'n','/æntˈæsɪd/','2022-06-20 02:45:55','https://www.oxfordlearnersdictionaries.com/media/english/us_pron/a/ant/antac/antacid__us_1.mp3',NULL,'2022-06-20 02:45:55',12),('antibiotic','a substance, for example penicillin, that can destroy or prevent the growth of bacteria and cure infections','thuốc kháng sinh','Important Antibiotic Modified to Combat Bacterial Resistance',NULL,125,'n','/ˌæntibaɪˈɑːtɪk/','2022-06-09 01:41:29','